import Image from "next/image";
import styled from "styled-components";

import Home1 from "../../../assets/images/homepage1.jpg";
import Home2 from "../../../assets/images/homepage2.jpg";
import Home3 from "../../../assets/images/homepage3.jpg";

const TextWelcome = (props) => {
  return (
    <Container>
      <H1>
        Frank is a people person, and a real window and door guy. With over four
        decades of
        <ImageS>
          <Image src={Home1} layout="fixed" height="60px" width="60px" />
        </ImageS>
        experience, Frankâ€™s success is
        <ImageS>
          <Image src={Home2} layout="fill" />
        </ImageS>
        all about strong industry partnerships, loyal customers, and
        longstanding employees. Frank is like family.
        <ImageS>
          <Image src={Home3} layout="fill" />
        </ImageS>
      </H1>
    </Container>
  );
};

const Container = styled.div``;

const H1 = styled.h1`
  display: grid;
  font-size: 8vw;
  line-height: 15vw;
  margin: 0;
  /* white-space: nowrap; */
  @media (min-width: 480px) {
    font-size: 4vw;
    line-height: 85px;
  }
`;

const ImageS = styled.div`
  display: grid;
  height: 60px;
  width: 60px;
  object-fit: contain;
`;

export default TextWelcome;
